INSERT INTO `user_tasks` (`id`, `user_id`, `subject`, `description`, `client`, `client_contact`, `task_datetime`, `task_hours`, `fault_of`, `resolved`, `created_at`, `updated_at`) VALUES
	(10, 12, 'Report confús de premi no pagat', 'Report confús de premi no pagat pq la màquina ha deixat fer apostes diferents per cilindre quan no està configurat així', '1', '', '2025-02-24 15:00:00', 1.000000, 'client', 1, '2025-02-25 08:49:26', '2025-02-25 11:28:17'),
	(12, 11, 'Intervención en cajero de VERSUS', '1) No habían puesto la licencia bien G30 y no les funcionaba el TicketController\n2) Su router de Orange o algo así de la sala hacia que la validación de apuestas Orenes no fuera bien. Se ha modificado hosts en system etc para forzar que se conecte a: 195.235.205.164 cashiers-gw.orenes.tech', '4', 'Pedro Cabrera', '2025-02-20 10:00:00', 5.000000, 'client', 1, '2025-02-25 11:14:14', '2025-02-26 11:31:51'),
	(13, 11, 'Donar d\'alta NOVOMATIC com a servei POST VENTA', 'Llistat de maquines "C:\\Work\\CCM\\CCM.Game\\Docs\\Novomatic\\allowed_2025-02-25 - 61.csv"', '5', 'Itay', '2025-02-25 10:00:00', 3.000000, 'client', 1, '2025-02-25 11:29:12', '2025-02-26 11:31:12'),
	(14, 12, 'No entenia els events de porta oberta del backoffice', 'No entenia els events de porta oberta del backoffice', '6', 'Carlos Gomez', '2025-02-25 18:04:00', 1.000000, 'client', 1, '2025-02-25 16:05:22', '2025-02-25 16:05:22'),
	(15, 11, 'Actualitzar Caixer NOVOMATIC per el seu I+D', 'Actualitzar Caixer NOVOMATIC per el seu I+D per fer proves de GBG TITO TicketIn', '5', 'Itay', '2025-02-26 10:00:00', 1.000000, 'client', 1, '2025-02-26 11:34:49', '2025-02-27 07:31:39'),
	(16, 12, 'Aclariment partida amb apostes IndyWheel', 'Un client deia que no havia cobrat el que tocava pq no entenien bé la informació del lastinfo ni les apostes amb diferents quantitats als mateixos números (IndiWheelBet). Després de mirar-ho bé, pq al webreporting no hi eren aquestes partides, està tot bé. El problema és que la font dins les fitxes és massa petita i costa de llegir. Hem confós un 1.8 amb un 1.9.', '1', 'Cristóbal', '2025-02-26 13:16:00', 2.000000, 'client', 1, '2025-02-26 12:18:52', '2025-02-26 12:18:52'),
	(18, 9, 'Epic Edge no funcionava correctament', 'La placa els hi va arribar amb el jumper del COM6 configurat a CCTalk. He posat una hora pq no podia posar els 12 minuts que realment he estat.', '1', 'Cristobal', '2025-02-27 16:08:00', 1.000000, 'client', 1, '2025-02-27 14:11:26', '2025-02-27 15:11:36'),
	(19, 11, 'Ajudar a Grupo VID instalació màquines Aristocrat', 'Ajudar a Grupo VID instalació maquines Aristocrat TITO contra caixer Gistra amb TicketServer (192.168.1.19)\n- Tenien un caixer de Gistra vell amb un firmware de Bill2Bill vell (es te que actualitzar, passat contacte de SPV SMI2000)\n- El caixer al ser vell no te en el seu TicketServer la funcionalitat de connectivitat i pertant el ready2b d\'Aristocrat bloqueja. Es pot solventar desactivant el parametre "Bloquear teminal si no hay comunicación" a NO a la configuració dels sats TicketServer Configuration\n\n', '7', 'SAT GrupoVid', '2025-02-27 16:18:00', 1.000000, 'client', 1, '2025-02-27 14:19:55', '2025-02-27 15:03:02'),
	(20, 11, 'Conexió SAS Evolution - Report credits pago manual erroni', 'Conexió SAS Evolution - Report credits pago manual erroni\n- Su sistema sas host CRS SYSTEM no soporta denominaciones diferente de 1centimo\n- Tambien necesita el chirping inicial\n- Se configura el SAS para que envie el chirping\n- Se configura el SAS paras que el pago manual se pfalse enviando en cientimos y no en creditos\n- La configuración es: Pago Manual modo reporte Cantidad\n ', '8', 'Jaime Abellan', '2025-02-27 10:00:00', 1.000000, 'client', 1, '2025-02-28 07:49:36', '2025-02-28 07:58:35'),
	(24, 10, 'Actualización cajeros', 'Actualizar software ccm.\nDesde estas salas no funcionaba el ftp a nuestro servidor por lo que no pudieron hacer la actualización por scripts', '9', 'Ricardo González', '2025-02-28 12:33:00', 1.000000, 'client', 1, '2025-02-28 10:35:50', '2025-02-28 10:38:17'),
	(26, 11, 'Ajuda per conectar GBG al Caixer NOVOMATIC per el seu I+D', 'Ajuda per conectar GBG al Caixer NOVOMATIC per el seu I+D\nS\'ajuda al departament de IT perque posin la maquina a internet\nAra queda fer proves amb un server de GBG', '5', 'Alberto', '2025-02-28 11:00:00', 2.000000, 'client', 1, '2025-02-28 14:38:54', '2025-02-28 14:39:13'),
	(27, 11, 'Ajuda a Versus amb caixer antic', 'Ayuda con bill2bill que cambian que no va\nAyuda con corrupción base de datos\nAyuda con licencias IPS', '4', 'Pedro Cabrera', '2025-03-03 18:00:00', 3.000000, 'client', 1, '2025-03-03 17:05:58', '2025-03-03 17:05:58'),
	(28, 11, 'Ajuda a configurar ticket2go per tests de NOVOMATIC', 'Intentem que els funcioni el ticket2go per TITO pero els fan falta aparells o coses al seu IT perque funcioni el enllaç\nUna perdua de temps', '5', NULL, '2025-03-03 12:00:00', 1.000000, 'client', 0, '2025-03-03 17:07:05', '2025-03-04 08:40:42'),
	(29, 11, 'Ajuda a configurar ticket2go per tests de NOVOMATIC', 'Es fa que el ticket2go per TicketIn funcioni un cop ells han solventat els seus problemes de xarxa', '5', NULL, '2025-03-04 10:00:00', 1.000000, 'client', 1, '2025-03-04 08:42:16', '2025-03-04 08:42:16'),
	(30, 11, 'ITSSAC error en la comunicació', 'INCIDENCIA:\n\nCon respeto al problema reportado \nCuando se va a realizar un pago por cajero ATM, internamente la maquina ATM envía a el Servidor de ITS dos comandos: \nComando 0: Que es una validación previa del Ticket, este comando indica si el ticket es valido o activo para poder usado por otros comandos (en este caso el Comando 2) \nComando 2: Si el Comando 0 responde indicando que el Ticket SI es valido/activo entonces el Cajero ATM envía el Comando 2 para realizar el pago. \n \nSe debe entender que tales comandos y la secuencia en que estos son usados están determinados en la Lógica de la propia Maquina ATM. \nPara el caso reportado se ve que primero se envía el Comando 0, y, a pesar que nuestro servidor le responde que el Ticket no es valido el propio Cajero ATM le envía el comando 2. \n \nA continuación envío el Historial de comandos recibidos por Cajero ATM ordenados desde el mas nuevo al mas antiguo. \nPrimeramente se ejecuta Comando 0 con la siguiente respuesta: \n-4&Ticket not activated&signature=EE88617BE6DCC5D5931207957204F2458AB1F912 \n(Es decir Ticket no activo/valido) esta respuesta debería ser suficiente para que Cajero ATM no prosiga con Comando 2, sin embargo si lo hace \nNOTA: Dicho Log se puede ver en la pantalla "Clientes" de nuestra aplicación Servidora. \n \n \nOrden	ClienteATM ClienteFecha, Comando,	ParamTicket, ParamATM,	Parametros Respuesta \n------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------ \n(2) 192.168.1.72	5/03/2025 10:43:24	2 075988591463095850,	999991 cmd=2&success=0&No=075988591463095850&machineID=999991&signature=bf74159fe2167c9f8f0d487f39cd78b45bbaaa2c,	0&Ok&signature=9BA8C30E0F4442654CBE4ADC859904C7DCA39A10 \n(1) 192.168.1.72	5/03/2025 10:43:24	0 075988591463095850,	999991 cmd=0&No=075988591463095850&machineID=999991&signature=fa5729e8a7495e0f0f245aac89e82122f923dc6d -4&Ticket not activated&signature=EE88617BE6DCC5D5931207957204F2458AB1F912', '10', 'Victor Briceño', '2025-03-06 11:00:00', 1.000000, 'client', 1, '2025-03-06 10:10:10', '2025-03-06 10:14:51'),
	(31, 11, 'Canvis a UK', 'Noves versions de software generades pels canvis demanats de passar de 50 linies els helps del BZZF a 25 linies\nHelps afectats 13 i 15\nEs fa en format BAK i es fan tots els processos per regenerar les versions\n- Oriol 4-5 hores canvis software\n- Amin 2-3 hores quality', '11', 'Nick Romano', '2025-03-06 08:00:00', 6.000000, 'client', 1, '2025-03-06 10:20:35', '2025-03-06 10:20:39'),
	(32, 11, 'Incidencia impresora pagament ruleta amb SAS-IPS', 'INCIDENCIA REPORTADA PER IPS  A RULETA AF.53.A4.1C.00.00\nRUL6342_HST\nmga - C.C Mataro Park Sport333\nSoftware: Magic Red - v4.0.2.0 (53000b) - 2022/02/01 18:38:57\n\n\nBon dia Oriol,\n \nEt reporto un cas que va passar diumenge passat poc abans de les 19h, a la posició 2 d’una ruleta d’MGA a la Sala Blanes de Sport333:\n \nHi ha 3 posicions (la 1, la 2 i la 8) que inicien un pagament de 4.600€ totes 3. La 1 i la 8 generen els tickets TITO corresponents per aquest import, però la 2 es queda amb el 3er TITO de 1.000€ (i a partir d’aquí genera pagaments manuals).\n \nEl tema és sobre el 3er ticket TITO, als logs del nostre Servidor TITO està marcat com a vàlid (rebem el TicketPrintComplete, que és quan la màquina ens confirma que s’ha pogut imprimir correctament), però la màquina no el considera un pagament vàlid i inicia el pagament mitjançant els pagaments manuals.\n \nT’ho reporto per si podeu mirar alguna cosa als logs de la màquina, si podeu saber el motiu per què va passar això. Nosaltres no tenim els Logs de la comunicació SAS amb la màquina, però amb els logs del TITO entenem que la màquina ens va confirmar que havia imprès el ticket correctament.\n \nAdjunto els logs del Servidor TITO. Si tens algun dubte sobre el cas o els logs em dius.\n \nSi trobeu alguna cosa, ja ens dieu.\n \nSalut i gràcies,\n \n \nJosep Mª Garcia\n', '12', 'Josep Maria IPS', '2025-03-06 12:30:00', 1.000000, 'client', 1, '2025-03-06 10:50:35', '2025-03-06 10:51:01'),
	(33, 11, 'Ayuda Maquina de UK BZZF', 'Se ayuda con la instalación R2UK6827 - GC Manchester Bury New Road', '11', 'Antonio', '2025-03-06 14:13:00', 1.000000, 'client', 1, '2025-03-06 12:14:14', '2025-03-06 12:21:57'),
	(36, 10, 'SRL no valida', 'El SRL service no validaba porque primero probaba en el puerto 1080 y acababa saltando timeout', '13', 'Antonio Morilla', '2025-03-07 12:01:00', 4.000000, 'us', 1, '2025-03-10 07:58:33', '2025-03-10 08:01:33'),
	(37, 10, 'HarwareLink no comunica', 'Ha necesitado el SSL Fake para que pudiera conectar con el HL', '1', NULL, '2025-03-10 09:30:00', 0.500000, 'us', 1, '2025-03-10 08:00:43', '2025-03-10 08:00:43'),
	(38, 11, 'Puloon mal configurat, error de item.HID no cassa amb Dispensed1..10 counters', 'Puloon mal configurat, desencadena un error introduit a partir: del 31 de octubre 2024 en adelante \n"error de item.HID 0 no cassa amb Dispensed1..10 counters"', '14', 'Juan Carlos', '2025-03-10 17:30:00', 2.000000, 'us', 1, '2025-03-10 15:34:54', '2025-03-10 15:34:54'),
	(39, 11, 'Afegida opcio a GBG MTOM per compatibilitzar amb sistema GBG de NBS', 'S\'ha modificat el software del caixer per afegir la opcio a GBG MTOM per compatibilitzar amb sistema GBG de NBS\nQueden pendents les proves de Ticket In i Ticket Out', '5', 'Oficina Técnica', '2025-03-12 12:00:00', 3.000000, 'client', 1, '2025-03-12 15:12:58', '2025-03-12 15:12:58'),
	(40, 10, 'RUL2104. Análisis pérdidas último mes', 'Artur nos dice que esta máquina lleva perdiendo mucho dinero y que los contadores de fichas no cuadran con los de dinero.\nEl descuadre se debe a que en el layout del webreporting no estaba bien puesto el valor del crédito (tarea de Laura) y a que tienen el SpinOne al 95%.\nLas pérdidas se han producido tanto en wheel físico como virtual y la cantidad de dinero jugado se ha triplicado en el último mes. No se observan anomalías.', '1', 'Artur', '2025-03-14 11:09:00', 4.000000, 'client', 1, '2025-03-14 09:18:52', '2025-03-14 09:18:52'),
	(41, 11, 'Ajudar a Meixide en la instalacio de ForwardSystems', 'Ajudar en una instalacio on ForwardSystems ha fet la feina mal feta', '15', 'Meixide', '2025-03-19 10:04:00', 1.000000, 'client', 1, '2025-03-19 08:08:00', '2025-03-19 08:08:46'),
	(42, 13, 'Proves TITO per límit validació tickets a Madrid', 'Es va fer la següent prova:\n\n- Generar dos tickets, un ticket de 20€ i un ticket de 21€\n- Introduir el ticket de 20€, i veure que la màquina l\'accepta correctament\n- Introduir el ticket de 21€, i veure que la màquina n\'accepta 20€ i retorna un ticket de 1€', '16', NULL, '2025-03-18 11:00:00', 0.500000, 'client', 1, '2025-03-20 07:12:24', '2025-03-20 07:12:24'),
	(43, 11, 'Prepara entorno SPV para PlayGroup', 'Prepara entorno SPV para PlayGroup\n1) Generados usuarios de web user_playgroup\n2) Preparar web de downloads\n3) Generado Custom PlayGroup de Global Controller\n4) Usuarios de base de datos de playgroup\n5) Instalado Global Controller\n6) Generados Listener scripts\n7) Cliente de WebReporting, base de datos, usuario, etc... y añadidas las 3 maquinas\n8) En el servidor SMI2000 añadido aviso de PlayGroup en caso de generar versiones de software', '17', 'Leonardo', '2025-03-20 08:30:00', 3.000000, 'client', 1, '2025-03-20 08:39:36', '2025-03-20 08:45:50'),
	(44, 11, 'Nueva versión para poder visualizar negativos en pantallas de gestión de sala y recarga de maquinas', 'Se genera nueva versión para poder visualizar negativos en pantallas de gestión de sala y recarga de maquinas', '9', 'Ricardo González', '2025-03-20 11:00:00', 0.500000, 'us', 1, '2025-03-20 09:36:10', '2025-03-20 09:36:10'),
	(45, 11, 'Actualizar un cajero para suministrar licencia GBG a un software antiguo', 'Actualizar un cajero para suministrar licencia GBG a un software antiguo\n- Se da licencias de GBG\n- Se instala el pingback\n\nPeticion realizada por Sebastian Marmolejo y Rafael Fernandez Fernandez', '18', 'Roberto Jimenez', '2025-03-21 10:30:00', 0.500000, 'client', 1, '2025-03-21 10:32:25', '2025-03-21 10:33:14'),
	(46, 11, 'Orenes calculo de tickets leidos por codigo de barras', 'Mejorar el calculo de tickets leidos por sistemas de codigo de barras que no sean con stacker\nPara que les cuadre la contabilidad', '14', 'Juan Carlos', '2025-03-25 10:00:00', 3.000000, 'us', 1, '2025-03-25 09:26:47', '2025-03-25 09:26:47'),
	(47, 11, 'Novomatic asistencia impresora per tickets GBG Epic950', 'Novomatic asistencia impresora per tickets GBG Epic950\nLa posen al COM3\nFeia falta instalar els drivers\nEl Firmware no era el correcte', '5', 'Oficina Técnica', '2025-03-27 11:12:00', 1.000000, 'client', 1, '2025-03-27 09:13:26', '2025-03-27 09:32:14'),
	(48, 11, 'ITSSAC proteger malas respuestas protocolo TITO', 'ITSSAC proteger malas respuestas protocolo TITO\nEn cajero de Casino La Esperanza\nEn el reddem ITSSAC, a veces, no envia correctamente la respuesta en tickets no validos\nDevolvia string vacio. Esto hace que validaramos como ok.\nSe protege el error.', '10', 'UBA', '2025-03-27 15:30:00', 2.000000, 'us', 1, '2025-03-27 20:25:47', '2025-03-27 20:26:26'),
	(49, 11, 'Formació MGA: Software i GlobalController', 'Formació MGA: Software i GlobalController', '1', 'Equip de SPV', '2025-03-28 10:00:00', 4.000000, 'client', 1, '2025-03-28 12:27:51', '2025-03-28 12:28:07'),
	(50, 12, 'Recuperació CCM després de canvi de placa', 'He ajudat al Cristóbal a desactivar el Firewall pq en canviar de placa, les regles que hi havia ja fetes, no són vàlides i s\'han de recrear de nou. Sinó, com és una Gauss vella, no comunica per ethernet. Ho he solucionat amb el FirewallOn.bat que hi ha al Deploy del SMIInstaller', '1', 'Cristóbal', '2025-03-31 16:07:00', 2.000000, 'client', 1, '2025-03-31 12:11:42', '2025-03-31 12:11:42'),
	(51, 11, 'Ayudar a Meixide a convencer a Luckia I.T.', 'Ayudar a Meixide a convencer a Luckia I.T. para la instalación y funcionamiento del Global Controller', '15', 'Meixide', '2025-03-31 12:30:00', 2.000000, 'client', 1, '2025-03-31 13:02:55', '2025-03-31 13:02:55'),
	(52, 11, 'Update de GamesAndWIns para los arreglos de SAS solicitados', 'Update de GamesAndWIns para los arreglos de SAS solicitados\nSe actualiza software de GamesAndWins para poder reportar todo en centimos y no en creditos\nSe falsea el protocolo SAS porque el sistema de CRS no soporta denominaciones diferentes a 1c', '8', 'Jaime Abellan', '2025-03-31 17:02:00', 1.000000, 'client', 1, '2025-03-31 13:04:09', '2025-03-31 13:04:09'),
	(53, 9, 'Impressora Epic950 no funcionava', 'Resulta que estava malament la configuració d\'impressora. Estava format SMI i havia d\'anar en format SAS-TITO. He posat que la culpa era del client perque normalment no deixem la configuració així nosaltres. Les 3 hores son entre avui i la setmana passada que també els vam atendre per aquest motiu. Els hi vam enviar un cable pensant que era culpa del cable.', '5', 'Novomatic Oficina Tecnica Whatsapp', '2025-04-01 13:32:00', 3.000000, 'client', 1, '2025-04-01 09:37:50', '2025-04-01 09:37:50'),
	(54, 11, 'Ayudar a instalar un TicketServer a JackpotSystems en un pc externo puesto por Gistra', 'Ayudar a instalar un TicketServer a JackpotSystems en un pc externo puesto por Gistra:\n- Nos conectamos por Supremo\n- Tenen com un PC que sembla un clone de un windows antic nostre\n- He tingut que fer un EvilInstaller del paquet pero ha fallat i no fa be el update del contingut del mysql\n- Sort havia fet copia del directory e:\\Mysql abans\n- Al final he baixat updateSQL.bat y despres si ha anat be el update del mysql\n- El updateSQL.bat l\'he executat desde la carpeta del instalador: ...EvilInstaller2\\Resources\\Projects\\TS', '9', 'Ricardo González', '2025-04-04 10:30:00', 2.000000, 'client', 1, '2025-04-04 08:49:16', '2025-04-04 08:49:16');
